class Solution:
    @classmethod
    def get_part_matched_values(cls, pattern):
        current_prefix = []
        current_suffix = []
        part_matched_values = []
        for char_index in range(0, len(pattern)):
            if pattern[:char_index]:
                current_prefix.append(pattern[:char_index])
            if pattern[1 : char_index + 1]:
                current_suffix = [
                    f"{item}{pattern[char_index]}" for item in current_suffix
                ]
                current_suffix.append(pattern[char_index])
            same_part = set(current_prefix) & set(current_suffix)
            if same_part:
                max_same = max(
                    [len(item) for item in set(current_prefix) & set(current_suffix)]
                )
            else:
                max_same = 0
            part_matched_values.append(max_same)
        return part_matched_values

    def str_str(self, haystack: str, needle: str) -> int:
        if not needle:
            return 0
        if len(haystack) < len(needle):
            return -1
        if len(haystack) == len(needle):
            for i in range(len(haystack)):
                if haystack[i] == needle[i]:
                    continue
                else:
                    return -1
            return 0
        part_matched_values = self.get_part_matched_values(needle)
        current_index = 0
        while current_index < len(haystack) - len(needle) + 1:
            all_matched = True
            next_steps = 1
            if haystack[current_index + len(needle) - 1] != needle[-1]:
                current_index = current_index + next_steps
                continue
            for sub_index in range(len(needle)):
                if haystack[current_index + sub_index] == needle[sub_index]:
                    continue
                else:
                    all_matched = False
                    next_steps = sub_index - part_matched_values[sub_index - 1]
                    if next_steps <= 0:
                        next_steps = 1
                    break
            if all_matched:
                return current_index
            else:
                current_index = current_index + next_steps
        return -1


if __name__ == "__main__":
    test_haystack = ""
    test_needle = ""
    print(Solution().str_str(test_haystack, test_needle))
